CREATE TABLE PlayerRecharge
(
    ID bigint(20) PRIMARY KEY NOT NULL,
    iZoneAreaID int(10) DEFAULT '0' NOT NULL,
    dtEventTime datetime NOT NULL,
    vGameAppid varchar(32) DEFAULT '',
    PlatID int(10) DEFAULT '0' NOT NULL,
    DVID varchar(64) DEFAULT '',
    BillNo varchar(64) DEFAULT '',
    GoodsID varchar(64) DEFAULT '',
    Cost float DEFAULT '0',
    Money int(10) DEFAULT '0',
    PayFrom varchar(32) DEFAULT '',
    sysType int(10) DEFAULT '0',
    sysCfgid int(10) DEFAULT '0',
    Level int(10) DEFAULT '0',
    Nickname varchar(64) DEFAULT '',
    UID bigint(20) DEFAULT '0',
    FBID varchar(64) DEFAULT '',
    APID varchar(64) DEFAULT '',
    RewardMoney int(10) DEFAULT '0'
);
CREATE INDEX simple_time ON PlayerRecharge (dtEventTime);
CREATE INDEX simple_uid ON PlayerRecharge (UID);
CREATE INDEX union_uid_time ON PlayerRecharge (UID, dtEventTime);
